import {makeAutoObservable} from "mobx"

class OneUser {
    constructor(){
        this._id = 1
    }
};



export default class UsersConteiner{
    constructor(){
        this._users = [
           new OneUser(),
           new OneUser()
        ]
        makeAutoObservable(this)
    }


    setUsers(users){
        this._users = users
    }

    get users(){
        return this._users
    }

    

}
